def iterblocks(text: str, begin_str: str, end_str: str):
    start_index = 0
    while True:
        try:
            index = text.index(begin_str, start_index) + len(begin_str)
            end_index = text.index(end_str, index)
            yield text[index:end_index]
            start_index = end_index + len(end_str)
        except ValueError:
            break


def extractdiv(text: str, begin_str: str):
    start_index = text.index(begin_str) + len(begin_str)
    balance = 1
    index = start_index
    while True:
        if text[index:].startswith('<div'):
            balance += 1
        elif text[index:].startswith('</div>'):
            balance -= 1
        if balance == 0:
            break
        index += 1
    return text[start_index:index]

for tr in iterblocks(table, '<tr', '</tr>'):
    tds = list(iterblocks(tr, '<td', '</td>'))
    name = next(iterblocks(tds[1], '<b>', '</b>')).strip()
    try:
        key = next(iterblocks(tds[5], '<code>', '</code>')).strip().removeprefix('minecraft:')
    except StopIteration:
        key = tds[6][1:].removeprefix('minecraft:')
    print(f'    "{key}": "{name}"')
